  false,\n\t\"url\": null,\n\t\"notes\": \"This metadata record describes the topographic
  mapping of Hancock and Jackson Counties, Mississippi during 2005. Using a combination
  of laser rangefinding, GPS positioning and inertial measurement technologies; LIDAR
  instruments are able to make highly detailed Digital Elevation Models (DEMs) of
  the earth's terrain, man-made structures and vegetation. This data was collected
  at submeter resolution to provide nominal 5m spacing of collected points. Multiple
  returns were recorded for each pulse in addition to an intensity value using a Leica
  ALS-50 Aerial Lidar Sensor.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
